INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 401, "アヤネ", 24001, 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 102301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2.21, "2030/12/17 14:59:59", 402, "アヤネ", 24002, 0.0, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 102301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 403, "アヤネ", 24003, 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 102301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (1.99, "2030/12/17 14:59:59", 701, "アサヒ", 24004, 0.0, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 192201, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2.21, "2030/12/17 14:59:59", 702, "アサヒ", 24005, 0.0, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 192201, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (3.33, "2030/12/17 14:59:59", 703, "アサヒ", 24006, 0.0, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 192201, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 801, "部員３", 24007, 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 192301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2.68, "2030/12/17 14:59:59", 802, "部員３", 24008, 0.0, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 192301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 803, "部員３", 24009, 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 192301, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 501, "", 24010, 0.0, 0.0, "やった！", 1, 192501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 502, "", 24011, 0.0, 0.0, "勝ったよ！", 1, 192501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 503, "", 24012, 0.0, 0.0, "いい調子！", 1, 192501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (5.33, "2030/12/17 14:59:59", 111, "ミサト", 24013, 0.0, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (6.85, "2030/12/17 14:59:59", 112, "ミサト", 24014, 0.0, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (3.0, "2030/12/17 14:59:59", 113, "ミサト", 24015, 0.0, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (6.11, "2030/12/17 14:59:59", 611, "ダイチ", 24016, 0.0, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 192401, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (6.75, "2030/12/17 14:59:59", 612, "ダイチ", 24017, 0.0, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 192401, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 613, "ダイチ", 24018, 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 192401, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (4.52, "2030/12/17 14:59:59", 211, "ハツネ", 24019, 0.0, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 113401, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (3.89, "2030/12/17 14:59:59", 212, "ハツネ", 24020, 0.0, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 113401, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (13.49, "2030/12/17 14:59:59", 213, "ハツネ", 24021, 0.0, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 113401, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (3.17, "2030/12/17 14:59:59", 311, "カヤ", 24022, 0.0, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 106501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (4.42, "2030/12/17 14:59:59", 312, "カヤ", 24023, 0.0, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 106501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (2.89, "2030/12/17 14:59:59", 313, "カヤ", 24024, 0.0, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 106501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (3.71, "2030/12/17 14:59:59", 421, "アヤネ", 24025, 0.0, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 102301, 3, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (5.1, "2030/12/17 14:59:59", 721, "アサヒ", 24026, 0.0, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 192201, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (4.34, "2030/12/17 14:59:59", 821, "部員３", 24027, 0.0, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 192301, 3, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 521, "", 24028, 0.0, 0.0, "いい勝負だったよ\nまたやろうね", 1, 192501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (5.62, "2030/12/17 14:59:59", 101, "ミサト", 24029, 0.0, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (9.58, "2030/12/17 14:59:59", 102, "ミサト", 24030, 0.0, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (0.0, "2030/12/17 14:59:59", 103, "ミサト", 24031, 0.0, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (9.13, "2030/12/17 14:59:59", 104, "ミサト", 24032, 0.0, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 113501, 1, 10046, 24, "2020/07/31 12:00:00");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (8.27, "2030/12/17 14:59:59", 105, "ミサト", 24033, 0.0, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 113501, 2, 10046, 24, "2020/07/31 12:00:00");
